/*
variable = memory locations where we store values

variable = value

3 most important types of variables: 
keyword: [bool] booleans =  true/false   
keyword: [uint] integers = signed and unsigned integers of varying sizes
keyword: [string] strings = string
*/

// lieDetector = boolean to check if true or false
// walletAmount = integer that would hold the amount
// errorMessageText = string

contract learnVariables {

    // all our solidity code

    uint chocolateBar = 10;
    uint storeOwner = 300;
    bool lieDetector = true;
    string errorMessageText = 'Error, you made a mistake';

}

// EXERCISE:

contract exercise {
    uint wallet = 500;
    bool spend = false;
    string notifySpend = 'you have spent money';
}

